import { Breadcrumb } from "antd";

const BreadCrumb = (...listBreadcrumb) => {
    const breadcrumb = listBreadcrumb.map(name => {
        return (
            <Breadcrumb.Item>{name}</Breadcrumb.Item>
        )
    })
    return (
        <Breadcrumb>
           {breadcrumb}
        </Breadcrumb>
    )

}

export default BreadCrumb;
